#include <iostream>
#include <vector>

using namespace std;

class Solution
{
public:
    int const INF = 1e9;
    int closestMeetingNode(vector<int> &edges, int node1, int node2)
    {
        int n = edges.size();
        vector<int> dist1(n, INF), dist2(n, INF);
        int current = node1, step = 0;
        while (current != -1 && dist1[current] == INF)
        {
            dist1[current] = step++;
            current = edges[current];
        }
        current = node2;
        step = 0;
        while (current != -1 && dist2[current] == INF)
        {
            dist2[current] = step++;
            current = edges[current];
        }
        int minDist = INF, result = -1;
        for (int i = 0; i < n; ++i)
        {
            if (dist1[i] != INF && dist2[i] != INF)
            {
                int maxDist = max(dist1[i], dist2[i]);
                if (maxDist < minDist)
                {
                    minDist = maxDist;
                    result = i;
                }
            }
        }
        return result;
    }
};

